import React from 'react';
import Card from './card'
import './card_sugges.css'

class CardSuggestion extends Card.Component{
  render(){
    return(
      <div class="col-12 othser">
        <div class="vl"></div>
        <h2 class="font-weight-bold">Other services</h2>
        <h6>Suggestions</h6>
      </div>
    )
  }
}
export default CardSuggestion
